import React from "react";
import { Text, TouchableOpacity, View } from "react-native";
import { faGear, faBookmark, faBell, faHeart } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-native-fontawesome";
import { RootStackParamList } from '../../../App';
import { StackNavigationProp } from '@react-navigation/stack';

import styles from "./styles";
import Footer from "../../components/Footer/Footer";
import { useFonts } from "expo-font";

type Navigation = {
    navigation: StackNavigationProp<RootStackParamList>;
}

const Profile : React.FC<Navigation> = ({navigation}) => {

    const [fontLoaded] = useFonts({
        'Inconsolata-Bold': require('../../../assets/fonts/Inconsolata-Bold.ttf'),
        'Inconsolata-Medium': require('../../../assets/fonts/Inconsolata-Medium.ttf'),
    });

    if (!fontLoaded) {
        return null;
    }

    return (
        <View style = {styles.container}>
            <View style = {styles.header}>
                <Text style = {styles.textHeader}>Hồ sơ</Text>
                <FontAwesomeIcon icon = {faGear} size={20}/>
            </View>

            <View style = {styles.ctnProfile}>
                <View style = {styles.ctnImage}>
                    <Text style = {styles.textHeader}>B</Text>
                </View>

                <View style = {styles.ctnInfo}>
                    <Text style = {styles.textName}>Bad liar</Text>
                    <Text style = {styles.textRole}>Thành viên cộng đồng</Text>
                    <TouchableOpacity style = {styles.btnEdit}>
                        <Text>Sửa hồ sơ</Text>
                    </TouchableOpacity>
                </View>
            </View>

            <View>
                <TouchableOpacity>
                    <FontAwesomeIcon icon = {faBookmark}/>
                    <Text>Đã lưu</Text>
                </TouchableOpacity>

                <TouchableOpacity>
                    <FontAwesomeIcon icon = {faHeart}/>
                    <Text>Đã thích</Text>
                </TouchableOpacity>

                <TouchableOpacity>
                    <FontAwesomeIcon icon = {faBell}/>
                    <Text>Thông báo</Text>
                </TouchableOpacity>
            </View>

            <Footer navigation={navigation}/>
        </View>
    )
};

export default Profile;
